import React from "react";
import AppLayout from "../components/AppLayout";

const Signup = () => {
  return (
    <>
      <head>
        <meta charSet="utf-8" />
        <title>Nodebird</title>
      </head>
      <AppLayout>会員登録 ページ</AppLayout>
    </>
  );
};

export default Signup;
